// src/App.tsx

import React from 'react';
import { BrowserRouter as Router, Route, BrowserRouter } from 'react-router-dom';
import HomePage from './HomePage';

const App: React.FC = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" component={HomePage} />
        </Routes>
    </BrowserRouter>
  );
};

export default App;
